export const Search = () => {
  return (
    <>
      <form className="row g-3">
      <div className="col-12">
      <label for="inputEmail4" className="form-label">Email</label>
      <input placeholder="abc@gmail.com" type="email" className="form-control" id="inputEmail4"/>
      </div>
      <div className="col-12">
      <label for="inputPassword4" className="form-label">Password</label>
      <input placeholder="********" type="password" className="form-control" id="inputPassword4"/>
      </div>
      <div className="col-12">
      </div>
      <div className="col-12">
      <button  type="submit" className="btn btn-danger">Log In</button>
      </div>
      <h6>Do you want to Sign Up ?<a href="/signup"><span>Sign Up</span></a></h6>
</form>
    </>
  );
};
